<div class="aem-Grid aem-Grid--24 aem-Grid--default--24 ">
    
    <div class="text aem-GridColumn--default--none aem-GridColumn aem-GridColumn--default--24 aem-GridColumn--offset--default--0">

    <div class="author-rte-styling  ">
        <p style="background: rgb(255,255,255);">[Music]</p>
<p style="background: rgb(255,255,255);">We're in a unique situation here at Truist.</p>
<p style="background: rgb(255,255,255);">In COVID-19 our world easily faded away.</p>
<p style="background: rgb(255,255,255);">When you think about it all we really got is each other. That's one of the things that we can learn out of this.</p>
<p style="background: rgb(255,255,255);">[Music]</p>
<p style="background: rgb(255,255,255);">Really it was just a regular call. He needed help getting onto his online banking.</p>
<p style="background: rgb(255,255,255);">As he was struggling, I was asking him was he okay.</p>
<p style="background: rgb(255,255,255);">He said, "Well I fell off the ladder trying to put a basketball hoop for my son."</p>
<p style="background: rgb(255,255,255);">His leg is in pain.</p>
<p style="background: rgb(255,255,255);">He had told me that he had had some surgeries on it and he shared with me that his son was special needs and that his son was kind of just like waiting for the basketball hoop.</p>
<p style="background: rgb(255,255,255);">It touched me, kind of almost felt like I was in pain.</p>
<p style="background: rgb(255,255,255);">He was in Georgia. I was here in North Carolina.</p>
<p style="background: rgb(255,255,255);">I wanted to go there and put up the basketball court for him myself. I wanted to go finish the job.</p>
<p style="background: rgb(255,255,255);">I got in touch with Michael Brown in the client's hometown.</p>
<p style="background: rgb(255,255,255);">I knew that everything was going to be okay because he was so eager.</p>
<p style="background: rgb(255,255,255);">The situation, I mean how could I walk away from that?</p>
<p style="background: rgb(255,255,255);">I felt there was no other choice. I went over to his house and climbed up in the attic and got the bolts through.</p>
<p style="background: rgb(255,255,255);">In that moment it was like the fog of COVID-19 lifted.</p>
<p style="background: rgb(255,255,255);">On my way that morning I'd stopped and got a little basketball.</p>
<p style="background: rgb(255,255,255);">He jumped up and he ran over there to the basketball and started you know throwing the ball up.</p>
<p style="background: rgb(255,255,255);">And all the time during this Paul's iming me and keeping up with it.</p>
<p style="background: rgb(255,255,255);">[Music]</p>
<p style="background: rgb(255,255,255);">Made me proud to work for this company our purpose here at Truist is to inspire and build better lives and communities and you can see it all around this company.</p>
<p style="background: rgb(255,255,255);">[Music]</p>
<p style="background: rgb(255,255,255);">If Michael Brown were standing here right now, I might just have to forget COVID protocols and just give him a hug.</p>
<p style="background: rgb(255,255,255);">I mean we formed a bond during that. I didn't know Paul before that but I always consider Paul my friend now.</p>
<p style="background: rgb(255,255,255);">I couldn't change the fact that he broke his hip. I couldn't change COVID-19. I could put up a basketball hoop.</p>
<p style="background: rgb(255,255,255);">[Music]</p>
<p style="background: rgb(255,255,255);">What seems so light and small for us can make such a difference in another person's life.</p>
<p style="background: rgb(255,255,255);">You may not be able to do a lot of things but do what you can.</p>
</div>
