<div class="aem-Grid aem-Grid--24 aem-Grid--default--24 ">
    
    <div class="text aem-GridColumn--default--none aem-GridColumn aem-GridColumn--default--24 aem-GridColumn--offset--default--0">

    <div class="author-rte-styling  ">
        <p style="background: rgb(255,255,255);">People are so worried about me they said that</p>
<p style="background: rgb(255,255,255);">why are you opening so many daycares?</p>
<p style="background: rgb(255,255,255);">Are you crazy?</p>
<p style="background: rgb(255,255,255);">And I said, yes, I love being crazy</p>
<p style="background: rgb(255,255,255);">because kids need daycare.</p>
<p style="background: rgb(255,255,255);">(upbeat music)</p>
<p style="background: rgb(255,255,255);">I would do anything to keep the children at the daycare</p>
<p style="background: rgb(255,255,255);">and my staff a job.</p>
<p style="background: rgb(255,255,255);">I would do anything.</p>
<p style="background: rgb(255,255,255);">(upbeat music)</p>
<p style="background: rgb(255,255,255);">One day I received a phone call. It was Scott from Truist.</p>
<p style="background: rgb(255,255,255);">I thought about this meeting that we had</p>
<p style="background: rgb(255,255,255);">about some of our Truist partnerships that we have</p>
<p style="background: rgb(255,255,255);">to help community, small businesses like Rashida's.</p>
<p style="background: rgb(255,255,255);">We got our partner on the phone,</p>
<p style="background: rgb(255,255,255);">put a little packet together, application,</p>
<p style="background: rgb(255,255,255);">and lo and behold about a month later, we got an email.</p>
<p style="background: rgb(255,255,255);">(bright music)</p>
<p style="background: rgb(255,255,255);">Rashida is awesome, Rashida is driven, she is inspiring.</p>
<p style="background: rgb(255,255,255);">But she was passed up and she shouldn't have been.</p>
<p style="background: rgb(255,255,255);">And that was an opportunity for us as Truist</p>
<p style="background: rgb(255,255,255);">to help this small business.</p>
<p style="background: rgb(255,255,255);">She's gonna do amazing things.</p>
<p style="background: rgb(255,255,255);">And it's all about her drive</p>
<p style="background: rgb(255,255,255);">and those little people out there</p>
<p style="background: rgb(255,255,255);">that are gonna be our leaders one day.</p>
<p style="background: rgb(255,255,255);">(gentle music)</p>
<p style="background: rgb(255,255,255);">The world would look awesome, beautiful and prospering</p>
<p style="background: rgb(255,255,255);">if we have many people like Scott, we need a lot of Scotts,</p>
<p style="background: rgb(255,255,255);">a lot of Scotts.</p>
<p style="background: rgb(255,255,255);">(gentle music)</p>
